import { Navbar, Nav, Button, NavDropdown, Form, FormControl } from "react-bootstrap";
import React, { useState, useEffect } from "react";
import classes from './Navbar.module.css'
import { Link, useHistory } from "react-router-dom";
import SearchRecipes from './SearchRecipes'
import AuthApi from "../context/AuthApi";
function Navbar1() {
  const Auth = useContext(AuthApi)
  const history = useHistory()
  const [isLoged, setIsLoged] = useState(false)
  useEffect(() => {
    const name = localStorage.getItem('name');
    if (name) setIsLoged(true)
  }, [])
  const logOut = () => {
    Auth.setA
  }
  return (
    <>
      <Navbar bg="light" expand="lg" className='sticky-top'>
        <Navbar.Brand href="/">Getnio</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link to='/login' href="/products">Gallery</Nav.Link>
            <Nav.Link href="/new-recipe">new recipe</Nav.Link>
            <NavDropdown title="Login" id="basic-nav-dropdown">
              <NavDropdown.Item href="/sign-up">Sign-up</NavDropdown.Item>
              <NavDropdown.Item href="login">Login</NavDropdown.Item>
              <NavDropdown.Item onClick={logOut}>log out</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown>
            {isLoged && <Nav.Link href="/profile">profile</Nav.Link>}
            {isLoged && <Nav.Link href="/profile">my recipes</Nav.Link>}
            <SearchRecipes />
          </Nav>

        </Navbar.Collapse>
      </Navbar>
    </>
  );
}

export default Navbar1;
